package config

import (
	"bytes"
	"encoding/base64"
	"fmt"
	"io"
)

type Font string

var (
	Fonts = map[string]Font{
		"rockwell": "",
		"loma":     "",
	}
)

func LoadFont(name string) (io.Reader, error) {
	font, ok := Fonts[name]
	if !ok {
		return nil, fmt.Errorf("unable to find font %s", name)
	}

	data, err := base64.StdEncoding.DecodeString(string(font))
	if err != nil {
		return nil, err
	}

	return bytes.NewReader(data), nil
}
